    return (
        <Card>
            <form>
                <div className="flex-container">
                    <div className="main">
                        <div class="flex-item">
                            <label>Username</label>
                            <input />
                        </div>

                        <div class="flex-item">
                            <label>Age (Years)</label>
                            <input />
                        </div>
                        <div class="flex-item">BUTTON</div>
                    </div>
                </div>
            </form>
        </Card>
    );
};

export default AddUser;
